function plot_temp_freq(data_temp_freq, name)

bunch_size = 200;
window_time = 0.0265; % [s]

data_temp_freq(1,:) = data_temp_freq(1,:) * 32000 / 355 * 1024 / 128;

temp_freq = zeros(bunch_size,3);
k = 1;
for i=1:bunch_size
    for j=1:data_temp_freq(3,i)
        temp_freq(k,1) = i * window_time;
        temp_freq(k,2) = data_temp_freq(1,k);
        temp_freq(k,3) = data_temp_freq(2,k);
        k = k + 1;
    end
end

%a = temp_freq(:,1);
%a(a<1) = a(a<1) + 3.5;
%temp_freq(:,1) = a - a(1);

figure;
scatter3(temp_freq(:,1),temp_freq(:,2)/1e3,temp_freq(:,3), 20, temp_freq(:,3), 'filled');
xlabel('Time [s]');
ylabel('Frequency [kHz]');
ylim([0 9]);
c = gray;
c = flipud(c);
colormap(c);
shading interp;
view(2);
matlab2tikz(name);

end